import Foundation

// 字符串比较 KMP
class Solution459 {
    func repeatedSubstringPattern(_ s: String) -> Bool {
        if s.count <= 1 {
            return false
        }
        let sCount = s.count
        let chars = Array(s)
        for i in 1...s.count>>1 {
            if sCount % i != 0 {
                continue
            }
            var match = true
            for j in i..<sCount {
                // if chars[j] != chars[j-i] {
                if chars[j] != chars[j % i] {
                    match = false
                    break
                }
            }
            if match {
                return true
            }
            
        }
        return false
    }
    
    func test() {
        //print(repeatedSubstringPattern(""))
        print(repeatedSubstringPattern("abab"))
         print(repeatedSubstringPattern("aba"))
         print(repeatedSubstringPattern("abcabcabcabc"))
        print(repeatedSubstringPattern(""))
        
        print(repeatedSubstringPattern(""))
    }
}
